import styled from 'styled-components';

export const UsersContiner = styled.div `
    display: flex;
    max-width: 90vw;
    flex-wrap: wrap;
    flex-direction: column;
    align-content: center;
`

export const UsersLi = styled.li `
    display: flex;
    flex-direction: column;
    width: 200px;
    margin: 30px;
    align-items: center;
`
